// App.js - Updated with Map Route
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';


// Import your existing components
import HomePage from './components/HomePage';
import LoginPage from './components/LoginPage';
import SignupPage from './components/SignupPage';
import HealthAssessment from './components/HealthAssessment';
import Dashboard from './components/Dashboard';
import MapPage from './components/MapPage'; // NEW: Import the map component
// Import other components as needed

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Home Route */}
          <Route path="/" element={<HomePage />} />

          {/* Authentication Routes */}
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />

          {/* Health Assessment Route */}
          <Route path="/health-assessment" element={<HealthAssessment />} />

          {/* Dashboard Route */}
          <Route path="/dashboard" element={<Dashboard />} />

          {/* NEW: Map Route */}
          <Route path="/map" element={<MapPage />} />

          {/* Forecast Route (if you have it) */}
          <Route path="/forecast" element={<div>Forecast Page - Coming Soon</div>} />

          {/* Profile/Risk Assessment Route (if you have it) */}
          <Route path="/risk-assessment" element={<div>Risk Assessment - Coming Soon</div>} />

          {/* Admin Route (if you have it) */}
          <Route path="/admin" element={<div>Admin Portal - Coming Soon</div>} />

          {/* Logout Route - Clear localStorage and redirect */}
          <Route 
            path="/logout" 
            element={
              <LogoutHandler />
            } 
          />

          {/* Catch all route - redirect to home */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

// Logout Handler Component
const LogoutHandler = () => {
  React.useEffect(() => {
    // Clear all user data from localStorage
    localStorage.removeItem('username');
    localStorage.removeItem('user_phone');
    localStorage.removeItem('user_id');
    localStorage.removeItem('has_health_assessment');

    // You can also clear any other user-related data

    // Redirect to home page
    window.location.href = '/';
  }, []);

  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      background: '#0f172a',
      color: '#f8fafc'
    }}>
      <div style={{ textAlign: 'center' }}>
        <div style={{
          width: '40px',
          height: '40px',
          border: '3px solid rgba(59, 130, 246, 0.2)',
          borderTop: '3px solid #3b82f6',
          borderRadius: '50%',
          animation: 'spin 1s linear infinite',
          margin: '0 auto 1rem'
        }}></div>
        <p>Logging out...</p>
      </div>
    </div>
  );
};

export default App;
